/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` char(32) DEFAULT NULL COMMENT '用户昵称',
  `account` varchar(45) NOT NULL COMMENT '账号',
  `password` varchar(45) NOT NULL COMMENT '密码\n',
  `token` varchar(45) DEFAULT NULL,
  `avatar` varchar(45) DEFAULT NULL,
  `age` int(11) DEFAULT NULL COMMENT '年龄\n',
  `sex` int(11) DEFAULT NULL COMMENT '性别:0:男，1：女',
  `phone` varchar(45) DEFAULT NULL COMMENT '手机号\n',
  `email` varchar(45) DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0:删除；1：正常',
  `logo_time` char(10) NOT NULL COMMENT '最后登录时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

